// # Place all the behaviors and hooks related to the matching controller here.
// # All this logic will automatically be available in application.js.
// # You can use CoffeeScript in this file: http://jashkenas.github.com/coffee-script/
	
$('document').ready(function() {
	
	$('input[type="checkbox"]').click(function(){
		if($(this).prop("checked") == true){
			$(this).siblings('img').addClass("highlight");
		}
		else if($(this).prop("checked") == false){
			$(this).siblings('img').removeClass("highlight");
		}
	});
	
	// http://keith-wood.name/countdown.html
	if(typeof tripDepartsAt !== 'undefined') {
		var d = new Date(parseFloat(tripDepartsAt));
		$('#defaultCountdown').countdown({until: d, compact: true, description: ''});
	};
	
	var fadeInSpeed = 400;

	$(".trip-pic").mouseenter(function() {
		$("#trip-image-modal").show();
	});
	$(".trip-pic").mouseleave(function() {
		$("#trip-image-modal").hide();
	});

	$(".trip-pic").click(function() {
		$("#trip-image-modal").click();
	});

	$("#edit-travel-text").click(function (e) {
		e.preventDefault();
		$('#trip-travel-text-form').fadeIn(fadeInSpeed);
		$('#travel-text').hide();
		$('#edit-travel-text').hide();
	});
	$("#cancel-travel-text").click(function (e) {
		e.preventDefault();
		$('#trip-travel-text-form').hide();
		$('#travel-text').show();
		$('#edit-travel-text').show();
	});

	$("#edit-name-tags").click(function (e) {
		e.preventDefault();
		$('#trip-name-tags-form').fadeIn(fadeInSpeed);
		$('.trip-name').hide();
		$('#edit-name-tags').hide();
	});
	$("#cancel-name-tags").click(function (e) {
		e.preventDefault();
		$('#trip-name-tags-form').hide();
		$('.trip-name').show();
		$('#edit-name-tags').show();
	});

	$("#edit-description").click(function (e) {
		e.preventDefault();
		$('#trip-description-form').fadeIn(fadeInSpeed);
		$('.description').hide();
		$('#edit-description').hide();
	});	
	$("#add-description").click(function (e) {
		e.preventDefault();
		$('#trip-description-form').fadeIn(fadeInSpeed);
		$('#add-description').hide();
		$('#trip_edit_description').focus();
	});
	$("#cancel-description").click(function (e) {
		e.preventDefault();
		$('#trip-description-form').hide();
		$('.description').show();
		$('#add-description').show();
		$("#edit-description").show();
	});
	
	$('#openJoinReq').click(function (e) {
		e.preventDefault();
		$("#join-req-form").slideDown(fadeInSpeed);
		$('#openJoinReq').hide();
		$('#join_req_content').focus();
	});
	$('#cancel-join-req').click(function (e) {
		e.preventDefault();
		$("#join-req-form").hide();
		$('#openJoinReq').show();
		$('#join_req_content').val("");
	});
	
	$('#new-stop').click(function (e) {
		e.preventDefault();
		$("#stop_to_name_dest").val("");
		$("#stop_to_name").val("");
		$("#stop_to_date").val("");
		$("#stop_from_name").val("");
		$("#stop-form").fadeIn(fadeInSpeed);
		$("#new-stop").hide();
		$("#cancel-stop").show();
		$('#stop_to_name_dest').focus();
	});
	$('#cancel-stop').click(function (e) {
		e.preventDefault();
		$("#stop_to_name_dest").val("");
		$("#stop_to_name").val("");
		$("#stop_to_date").val("");
		$("#stop_from_name").val("");
		$("#stop-form").hide();
		$("#new-stop").show();
		$("#cancel-stop").hide();
	});
	
	function hideOnbardingPartials() {
		$("#onboarding-who").hide();
		$("#onboarding-when").hide();
		$("#onboarding-stops").hide();
		$("#onboarding-purpose").hide();
		$("#onboarding-profile").hide();
		$(".trip-category").removeClass("active");
	};
	
	$('.onboarding-goto-who').click(function() { hideOnbardingPartials(); $(".travel-companions").addClass("active"); $("#onboarding-who").fadeIn(fadeInSpeed); });
	$('.onboarding-goto-when').click(function() { hideOnbardingPartials(); $(".travel-details").addClass("active"); $("#onboarding-when").fadeIn(fadeInSpeed); });
	$('.onboarding-goto-stops').click(function() { hideOnbardingPartials(); $(".travel-details").addClass("active"); $("#onboarding-stops").fadeIn(fadeInSpeed); });
	$('.onboarding-goto-purpose').click(function() { hideOnbardingPartials(); $(".travel-details").addClass("active"); $("#onboarding-purpose").fadeIn(fadeInSpeed); });
	$('.onboarding-goto-profile').click(function() { hideOnbardingPartials(); $(".about-you").addClass("active"); $("#onboarding-profile").fadeIn(fadeInSpeed); });

	$(".form-fancy").on("keypress", function (e) {
	    if (e.keyCode == 13) {
	        return false;
	    }
	});

});

